import React, { useContext, useEffect, useState } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { UserContext } from "../context/UserProvider";
import GeneralClasification from "../components/GeneralClasification";
import JornadasClasification from "../components/JornadasClasification";

const Home = () => {
  const { getTeams } = useContext(UserContext);
  const [teams, setTeams] = useState([]);

  const fetchTeams = async () => {
    let teamsAux = await getTeams();
    setTeams(teamsAux);
  };

  useEffect(() => {
    fetchTeams();
  }, []);

  return (
    <div className="pageBackground">
      <Header />
      <div className="tableContainer">
        <GeneralClasification teams={teams} />
        <JornadasClasification teams={teams} />
      </div>
      <Footer />
    </div>
  );
};

export default Home;
